{
  "standards": [
    {
      "code": "CCSS.MATH.CONTENT.7.NS.A.1",
      "description": "Apply and extend previous understandings of addition and subtraction to add and subtract rational numbers; represent addition and subtraction on a horizontal or vertical number line.",
      "jurisdiction": "Common Core State Standards (CCSS)",
      "gradeLevel": "7",
      "subject": "Mathematics"
    },
    {
      "code": "CCSS.MATH.CONTENT.7.NS.A.2",
      "description": "Apply and extend previous understandings of multiplication and division and of fractions to multiply and divide rational numbers; understand and apply rules for multiplying and dividing integers (sign rules).",
      "jurisdiction": "Common Core State Standards (CCSS)",
      "gradeLevel": "7",
      "subject": "Mathematics"
    },
    {
      "code": "CCSS.MATH.CONTENT.6.NS.B.4",
      "description": "Find the greatest common factor and least common multiple of two whole numbers; use prime factorization to express a number as a product of primes.",
      "jurisdiction": "Common Core State Standards (CCSS)",
      "gradeLevel": "6",
      "subject": "Mathematics"
    },
    {
      "code": "CCSS.MATH.CONTENT.6.EE.A.2",
      "description": "Write, read, and evaluate numerical expressions, including with parentheses and negative numbers (order of operations).",
      "jurisdiction": "Common Core State Standards (CCSS)",
      "gradeLevel": "6",
      "subject": "Mathematics"
    }
  ],
  "rigor": {
    "level": "mild",
    "dokLevel": "1-2",
    "justification": "The items primarily require procedural computation (prime factorization, adding/subtracting/multiplying/dividing integers, plotting/comparing integers on a number line, and evaluating expressions using order of operations). These are routine procedures and simple applications of rules rather than multi-step problem solving or deep reasoning, so Depth of Knowledge is centered at DOK 1 (recall/perform) and low DOK 2 (basic application).",
    "confidence": 0.88
  }
}

